import React from 'react';
// import { NavLink } from 'react-router-dom';

import './UserItem.css';

const userAttendanceItem = props => (
  <li key={props.key} className="users__list-item">
    <div>
      <h1> Date: {props.date}</h1>
      <p>
        Status: {props.status}
      </p>
      <p>
        Description: {props.description}
      </p>

    </div>
    <div>
    <button className="btn" onClick={props.onDetail.bind(this, props._id)}>
          View Details
        </button>
    </div>
  </li>
);

export default userAttendanceItem;
